description:
Bret Easton Ellis
narrated by Christian Rummel


Written when the author was 20, this first novel tells the story of Clay, a New Hampshire college student who returns home to Los Angeles for Christmas vacation. Vignettes show Clay and his friends aimlessly traveling from party to party, doing drugs, having sex with one another. PW noted that Ellis &quot;brilliantly conveys this crowd's delirium as well as the lack of fulfillment they cannot remedy.&quot;
